%[text] %[text:anchor:T_537367A9] # Fun with color models
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] Recall that Color Models are an abstract mathematical model used to describe colors on computers. In this script we will compare the following additive color models:
%[text] - RGB
%[text] - HSV \
%[text] %[text:anchor:T_8ED8CF49] # HSV vs RGB Color model
%[text] %[text:anchor:T_3E1AB6FB] Recall that RGB is a color model that replicates the concept of activating the S, M, and L cone cells in our eyes.
%[text] The HSV model is slightly different. It encodes more properties of light, such as brightness or saturation. 
%[text] HSV stands for Hue, Saturation, and Value. Hue is the color, Saturation indicates how much white is in that color, and Value indicates the Brightness
%[text] %[text:anchor:H_CFA4FFE8] ## RGB Vs HSV
%[text] ![](text:image:75c5)
%%
%[text] ## 
%%
%[text] %[text:anchor:H_973D3CD3] ## Explore the HSV colorspace
%[text] ![](text:image:4cbb)![](text:image:24f9)
%[text] ![](text:image:6bd3)![](text:image:973e)
%%
%[text] ## So, Is My Blue your Blue
%[text] [https://ismy.blue/](https://ismy.blue/) 
%[text] People have different names for the colors they see. [Language can affect how we memorize and name colors](https://en.wikipedia.org/wiki/Sapir%E2%80%93Whorf_hypothesis). This is a color naming test designed to measure your personal blue-green boundary. 
%[text] Color perception is tricky to measure--vision scientists use specialized calibrated equipment to measure color perception. Graphic designers use physical color cards, such as those [made by Pantone](https://www.npr.org/2024/07/19/1197961103/pantone-colors-lawrence-herbert-stuart-semple-standards), so that they can communicate colors unambiguously. Here we use your monitor or phone to test how you categorize colors, which is far from perfect, since your calibration may differ from mine. 
%[text] ![](text:image:0b9b)
%[text] Hue 120 is green, and hue 240 is blue (on a 360 degree scale)
%[text] 
mmSetUnitDataFolder(2);
T = readtable("IsMyBlueYourBlue2025.csv"); % the results are in!
%%
%[text] ### Display Class Results
figure
overlay_hue_hist(T,168, 190); % default 168 190
%%
function overlay_hue_hist(T, hue_start, hue_end)
% Define the size of the image
width = hue_end-hue_start;
height = 10;

hsNorm = hue_start/ 360; % Normalize to [0, 1] 168
heNorm = hue_end / 360; % Normalize to [0, 1]  190

% Create a linear hue gradient
hue_grad = linspace(hsNorm, heNorm, width); % evenly spaced numbers from start to end

% Create an HSV image
hsv_image = zeros(height, width, 3);
hsv_image(:,:,1) = repmat(hue_grad, height, 1); % Set the hue channel
hsv_image(:,:,2) = 1; % Full saturation
hsv_image(:,:,3) = 1; % Full value

% Convert HSV to RGB
rgb_image = hsv2rgb(hsv_image);

% Display the image
% imagesc(rgb_image);

nexttile
histogram(T.hue,FaceColor='k')
xlim([hue_start hue_end])

nexttile
% image([hue_start,0],[hue_end 5],rgb_image)
imagesc(rgb_image)

axis xy
title('Is My Blue Your Blue?');% Set x-axis limits and ticks
xlim([1 width]); % Set x-axis limits to the width of the image
xticks(linspace(1, width, 5)); % Set 5 ticks along the x-axis
xticklabels(round(linspace(hue_start, hue_end, 5))); % Label ticks with hue values
xlabel('Hue Values (Degrees)'); %
set(gca,'YColor','none')

end
%%
%[text] ## Create Hue Color Bar
%[text] I have added a function to the bottom of this live script that creates a rainbow image from the **hsv** colormap and then manipulates its S and V values as follows
%[text] - top row: modify S range
%[text] - middle row: unadulterated
%[text] - bottow row: modify V range \
clearvars
HSVM = get_hsv_img;
imshow(HSVM)
ylabel('V | hsv | S')
%[text] - open HSV and HSV2 in Color thresholder and select the HSV color model
%[text] - reduce color intensity by half in one half of the image \
