%[text] %[text:anchor:T_724287CC] # Color segmentation
%[text] Download an image of a swimmer
clear
close all

imgRGB = imread('swimmer1.jpg');

figure;
imshow(imgRGB)
%%
%[text] %[text:anchor:H_E3F8166D] ## Convert to HSV
%[text] convert the image to an HSV color model
figure

imgHSV = rgb2hsv(imgRGB);
imshow(imgHSV)
%[text] - looks weird because its not an RGB image, but we are displaying it as if it is were  \
%%
%[text] %[text:anchor:H_60E176E3] ## Compare HSV to RGB
clf;
tiledlayout(2,4,"TileSpacing","none","Padding","tight")

cols = 4;

% display RGB vs HSV
nexttile(1)
imshow(imgRGB)
title('RGB')

nexttile(1+cols);
imshow(imgHSV)
title('HSV')

rgb_titles = {'red', 'green', 'blue'};
hsv_titles = {'hue', 'saturation','value'};

% display 'channels
ch_idx = 1; % channel index
for n= 2:cols
    
    % show rgb channels
    nexttile(n);
    imshow(imgRGB(:,:,ch_idx))
    title(rgb_titles{ch_idx});
    
    % show hsv "channels"
    nexttile(n+cols)
    imshow(imgHSV(:,:,ch_idx))
    title(hsv_titles{ch_idx})
    
    % increment channel index
    ch_idx = ch_idx+1;
end
impixelinfo
%[text] - notice the HSV channels are kind of weird - they don't display as a normal RGB image
%[text] - hover over the ocean in the hue 'channel' and note the 'intensity' \
%%
%[text] %[text:anchor:H_95473E67] ### Hue Distribution
%[text] %[text:anchor:H_F2093759] Let's examine the distribution of hues in the image
figure
imshow(imgRGB)
%%
figure
subplot(1,2,1)
imshow(imgRGB)

subplot(1,2,2)
hues = im2uint8(imgHSV(:,:,1)); % convert hue values to integer values to match hsv colorbar
imhist(hues,hsv)
%[text] - So, basically we have blues and reds in this image
%[text] - Notice that the blues have a greater hue value than all of the colors in the swimmer.  \
%%
%[text] %[text:anchor:H_0CD6D8ED] ## Change Hue in Image
%[text] In an HSV image, we can change the hue by changing the values in the H channel. 
%[text] To selectively choose a hue, we create a logical array for the values we want to change (e.g. H\> 0.35 & H \<0.45).
%[text] To select the ocean, we take the mean of the entire H channel (since the ocean hue is most of the image). Then we replace all values that fall within 
%[text] Then we change all those values to a different value. We will use the H channel in HSV to select the blue colors of the ocean and change to another hue
imgHSV = rgb2hsv(imgRGB); %convert to hsv

%select hue and index
Hue_value = 0.8; % What happens when you change this value? %[control:slider:1136]{"position":[13,16]}

% Change the ocean values (use mean since ocean pixels all have basically the same color)
Hue_ch = imgHSV(:,:,1); % index out hue channel
Hmean = mean2(Hue_ch); % calculate the mean of the whole image (mean2 returns 1 number)
Hue_ch(Hue_ch>Hmean) = Hue_value; % replace with new hue value
imgHSV(:,:,1) = Hue_ch; % add channel back into HSV image

% Convert the modified HSV image back to an RGB image
C = hsv2rgb(imgHSV);

clf;
imshow(C)
title(sprintf('Hue Value = %1.1f',Hue_value))
%[text] - This color modification would be really hard to do with RGB images \
%[text] 
%%
%[text] %[text:anchor:H_2ECC6393] ## Change Saturation
%[text] Saturation provides highlights. In this example, we will multiply the channel values by a factor (thereby reducing or increasing all saturation values by a given percentage)
clf
imgHSV = rgb2hsv(imgRGB); % convert to HSV
Sat_ch = imgHSV(:,:,2); % extract the saturation channel

saturation_factor = 1; % increase / decrease saturation %[control:slider:1d52]{"position":[21,22]}
Sat_ch(:,:) = Sat_ch(:,:) * saturation_factor; 
imgHSV(:,:,2) = Sat_ch;
C = hsv2rgb(imgHSV);

figure;
tiledlayout(1,2,"TileSpacing","none","Padding","none")

ax1 = nexttile;
imshow(imgRGB) % display the RGB version
title('original')

ax2 = nexttile;
imshow(C) % display the modified HSV version
title(sprintf('Saturation Factor  %1.2f', saturation_factor))
%%
%[text] %[text:anchor:H_7393AC70] ## Change Value
%[text] Value provides shadowing and depth. 
%[text] This code adjusts the Value by multiplying by a factor (instead of a global value)
clf
imgHSV = rgb2hsv(imgRGB); % convert to HSV
V = imgHSV(:,:,3);

Value_factor = 2; %[control:slider:5784]{"position":[16,17]}

V = V*Value_factor; % what happens if you change this value ?
imgHSV(:,:,3) = V;

imgHSVmod = hsv2rgb(imgHSV);

figure;
tiledlayout(1,2,"TileSpacing","none","Padding","none")

nexttile;
imshow(imgRGB)
title('original')
nexttile;
imshow(imgHSVmod)
title(sprintf('Value Factor  %1.2f', Value_factor))
%[text] - This is easier than manipulating RGB \
%%
%[text] %[text:anchor:T_BEF4F98F] # Local Functions
%[text] %[text:anchor:T_1A00A2D2] This function creates the HSV rainbow image for the first example
function [HSVM, rows, S] = get_hsv_img
rows = 250;
cm = hsv(1000);
HSV = (repmat(reshape(cm,1, length(cm),3),rows,1,1)); % convert colormap to RGB image (creates the Hue space)

S = linspace(0,1,rows)';  % create a 1X500 vector of fractions from 0 to 1
S = repmat(S,1,1000,3);  % replicate vector into an array that matches the size of HSV
HSVM = cat(1, HSV.*S,HSV, flipud(mat2gray(HSV+S))); % Create new image o
end

